var Profile = (function() {
  var getName = function() {
    return localStorage.getItem("full_name") || ""; 
  };

  var setName = function(name) {
    localStorage.setItem("full_name", name);    
  };

  var getId = function() {
    return localStorage.getItem("user_id") || 0;  
  };

  var setId = function(id) {
    localStorage.setItem("user_id", id);     
  };

  var getStorageId = function() {
    return localStorage.getItem("storage_id") || 0; 
  };

  var setStorageId = function(id) {
    localStorage.setItem("storage_id", id);     
  };

  var getStorageName = function() {
    return localStorage.getItem("storage_name") || ""; 
  };

  var setStorageName = function(sName) {
    localStorage.setItem("storage_name", sName);     
  };

  return {
    getName: getName,
    setName: setName,
    getId: getId,
    setId: setId,
    getStorageId: getStorageId,
    setStorageId: setStorageId,
    getStorageName: getStorageName,
    setStorageName: setStorageName,
  };
})();

export default Profile;
